// for etsting purpoes
export type ToolToken = string | ToolExecutionEvent;
export type ToolExecutionToken = {
  tool_name: string;
  arguments?: Record<string, any>;
  response?: string;
};

export type ValidTools = RangeQueryArguments;
export type RangeQueryArguments = {
  duration: string;
  end: string;
  query: string;
  start: string;
  step: string;
};

export function isValidToolArguments(obj: any): obj is ValidTools {
  return isRangeQueryArguments(obj);
}

export function isRangeQueryArguments(obj: any): obj is RangeQueryArguments {
  return (
    obj &&
    typeof obj.duration === 'string' &&
    typeof obj.end === 'string' &&
    typeof obj.query === 'string' &&
    typeof obj.start === 'string' &&
    typeof obj.step === 'string'
  );
}

export function isToolExecutionToken(token: any): token is ToolExecutionToken {
  if (typeof token === 'string') {
    return false;
  }

  if (typeof token?.token === 'string') {
    return false;
  }

  return true;
}

export type ToolExecutionEvent = {
  event: 'tool_call';
  data: {
    id: number;
    role: 'tool_execution';
    token: ToolToken;
  };
};

